import classes from './Modal.module.css';
import Card from '../UserInterface/Card';
import { useState } from 'react';
import { Redirect } from "react-router-dom";

function Modal(){
    const SignInviaMicro = () => {
        // <Navigate to="/microsoft" />
        // sign up via microsoft
    }
    const TaketoSignupPage = (e) => {
        e.preventDefault();
        <Redirect to="/signup" />
    }
    return (
        <Card>
            <div className={classes.modal}>
                <button onClick={SignInviaMicro}>Login using your IITG outlook account</button>
                <button onClick={TaketoSignupPage}>Create your Account</button>
            </div>
        </Card>
    );
}
 
export default Modal;
